    message: "طيب هو laptop ولا pc ؟ \nلو labtop جربه على network ثانية أو ممكن تعمل
      hotspot من موبايلك عليه وبرده لو عندك WiFi card على ال pc اعمل نفس الموضوع وشوف
      هل هو من ال network ولا من ال device نفسه .. \n\nثاني حاجة بقي ادخل على اي settings
      خاصة بال network connection .. وكمان ال browser settings بتاعت كل ال browsers
      اللي عندك واعمل ليهم rest .. \n\nولو لسه برده ادخل بقى على task manager وشوف
      اي app أو service غريبة انت مش عارفها ودور عليها إذا كانت متعلقة بحاجة زي vpn
      أو proxy أو أي حاجة .. \n\nلأن انت ال ip بتاعك كده السعودية يعني يا اما vpn
      شغال يا اما proxy .. لكن مش ليه علاقة بآل DNS مادام ال ip متغير"
